  false,\n\t\"url\": null,\n\t\"notes\": \"The Fin Rot (F006) dataset contains data
  from examinations of thenbiological condition of diseased fishes. For tow samples
  collected, dataninclude: total number of individuals of a given species, number
  ofndiseased fish of that species, and extent of damage to the body andnvarious fins
  for up to three selected diseased individuals. Thenspecimens are identified by the
  NODC Taxonomic Code. The survey,ninstitution, senior scientist and station are identified.
  Parametersndefining environmental conditions at the sample location at the time
  ofncollection (e.g., water temperature and salinity, air temperature, windndirection
  and speed) may also be recorded.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
